import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ContactUs from "./components/contact.jsx";
import Newsletters from "./pages/newsletter.jsx";

function App() {
  return (
//<div class="absolute inset-0 -z-10 h-full w-full items-center px-5 py-24 [background:linear-gradient(125deg,#005276,#38ef7d)]"></div>
<div class="absolute inset-0 -z-10 h-full w-full items-center px-5 py-24 [background:radial-gradient(125%_125%_at_50%_10%,#005276_40%,#38ef7d_100%)]">
 <Router>
 <Routes>
   <Route path="/" element={<h1>Welcome to the App</h1>} />
   <Route path="/contact" element={<ContactUs />} />
   <Route path="/newsletters" element={<Newsletters />} />
 </Routes>
</Router>

</div>
  );
}

export default App;
